import React, { Component, Fragment } from 'react';
import Counter from './Counter'

class CounterPanel extends Component {
    constructor(...args){
        super(...args)
        this.state = {
            'First': 0,
            'Second': 10,
            'Third': 20
        }
    }
    render() {
        return (
            <Fragment>
                <Counter caption={'First'} initVal={this.state.First}/>
                <Counter caption={'Second'} initVal={this.state['Second']}/>
                <Counter caption={'Third'} initVal={this.state['Third']}/>
            </Fragment>
        )
    }
}

export default CounterPanel;
